import React from "react";

function note(props) {
  return ( < div className = "note top" >
    <
    div >
    <
    h1 className = "name" > {
      props.name
    } < /h1> </div >
    <
    div className = "info" > <
    img className = "circle-img"
    src = {
      props.image
    }
    alt = "celebrity-img" / >
    <
    p > {
      props.tel
    } < /p > <
    p className = "bottom" > {
      props.email
    } < /p > </div > < /
    div > );
}

export default note;
